import React from 'react';

function ProfileImage({ imagePath }) {
    return (
        <div className="profile-image-container">
            <img src={imagePath} alt="Profile" className="profile-image-container__image" />
            <p className="profile-image-container__points">1200pts</p>
        </div>
    );
}

export default ProfileImage;
